function ScrollToTop() {
  const { pathname } = useLocation();

  useEffect(() => {
    document.querySelector(".overflow-y-scroll").scrollTo({
      top: 0,
      left: 0,
      behavior: "instant", // Optional if you want to skip the scrolling animation
    });
  }, [pathname]);

  return null;
}
